def bianry_search(seq,key):
	# using recursion return only true false 
	if len(seq) == 0:
		return False
	else:
		mid = len(seq)//2

		if seq[mid] == key:
			return True
		else:
			if key < seq[mid]:
				return bianry_search(seq[:mid],key)
			else:
				return bianry_search(seq[mid+1:],key)

	# using iteration return index of found element 
	low = 0 
	high = len(seq)

	while low < high :
		mid = (low + high) / 2
		if seq[mid] == key:
			return mid
		elif seq[mid] > key:
			high = mid - 1

		else:
			low = mid + 1

